import React from 'react'
import './Video.css';

function Video() {
    return (
        <div className="video">
            <video 
                className="video__player" 
                loop
                src="https://encrypted-vtbn3.gstatic.com/video?q=tbn:ANd9GcQ2i73gF6g3obG6BfpYrQGOJAbg7JTmpxU6nAK19OwE_O465TOx" controls autoplay>

            </video>
              {/* VideoFooter */}
              {/* VideoSidebar */}

        </div>
    )
}

export default Video
